import { makeStyles } from '@material-ui/core'
import Box from '@material-ui/core/Box'
import Option from './Option'

const Select = props => {
  const classes = useStyles()

  return (
    <ul>
      <Option type={props.type} />
    </ul>
  )
}

export default Select
